import React from 'react';
import { Box, Typography } from "module";
// import SkillData from './SkillData';

const SkillData = [{
    title: "HTML",
    classnames: "progress-bar progress-bar-striped progress-bar-animated",
    width: "100%"
}, {
    title: "CSS",
    classnames: "progress-bar bg-success progress-bar-striped progress-bar-animated",
    width: "95%"
}, {
    title: "JavaScript",
    classnames: "progress-bar bg-warning progress-bar-striped progress-bar-animated",
    width: "95%"
}, {
    title: "JQuery",
    classnames: "progress-bar bg-danger progress-bar-striped progress-bar-animated",
    width: "95%"
}, {
    title: "Bootstrap",
    classnames: "progress-bar bg-secondary progress-bar-striped progress-bar-animated",
    width: "98%"
}, {
    title: "React Js",
    classnames: "progress-bar bg-info progress-bar-striped progress-bar-animated",
    width: "80%"
}, {
    title: "Wordpress",
    classnames: "progress-bar bg-warning progress-bar-striped progress-bar-animated",
    width: "90%"
}];


const Skills = () => {
    return (
        <>
            {SkillData.map((item, index) => {
                return (<><Box>
                    <Typography>{item.title}</Typography>
                </Box></>)
            })}
        </>
    )
}

export default Skills;
